import React from "react";
import {Button, Container} from 'react-bootstrap';
import logo from "./image/logo.png"


export default class Home extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            }
        this.bind();
        };
    bind() {
        this.redirectFromWhats = this.redirectFromWhats.bind(this);
    }

    redirectFromWhats(){
        return window.open("https://api.whatsapp.com/send/?phone=5511948816521&text&type=phone_number&app_absent=0")
    }

    render() {
        return (
        <>
            <Container>
                <img src={logo}/>
                <Button className="btn btn-primary"  onClick={() => this.redirectFromWhats()}>
                    <i className="bi bi-whatsapp"></i>
                    Agendar consulta
                </Button>
            </Container>
        </>
        )
    }
}
